void PortD_Init(void){
	volatile uint32_t delay;
	SYSCTL_RCGC2_R |= 0x08;
	delay = SYSCTL_RCGC2_R;
	GPIO_PORTD_AMSEL_R &= ~0x81;
	GPIO_PORTD_PCTL_R &= ~0x00000081;
	GPIO_PORTD_DIR_R &= ~0x81;			// 2) make PD0 input
	GPIO_PORTD_DEN_R |= 0x81;			// 4) ENABLE digital I/O on PD0
}

