int main(void){
	while(1){
		TExaS_Init(SSI0_Real_Nokia5110_Scope);  // set system clock to 80 MHz
		SysTick_Init();
		PortD_Init();
		ADC_Init();
		DAC_Init();
		Random_Init(1000);
		Output_Init();
		IntroScreen();
		Sound_Init(7256);
		EnableInterrupts();
		DrawRoad();
		
		Score=0;	
		lane = 0;
		extralife=1;
		treasure=1;
		clearvariable=0;
		level=1;
		lives=3;
		hit4lives=0;
		snakedirection=1;
		snakex=0;

		while(level<=8){
			
			while(lane < 6){
				for(int x = 0; x < 4; x++){
				 if(powerUp[x] == level)
				 {
					switch(x)
					{
					 case 0:if(extralife==1)
									{
										ST7735_DrawBitmap(70,71,fullheartgreen,10,9);
										if(lane==3 && ((143*Data/4095 < 71 && 143*Data/4095+20 >71)||(143*Data/4095 < 80 && 143*Data/4095+20 >80)))
										{
											extralife=0;
											lives++;
											if(lives==4)
											{
												ST7735_DrawBitmap(120,8,fullheart,10,9);
												hit4lives=1;
											}
											else if(lives==3)
												ST7735_DrawBitmap(130,8,fullheart,10,9);
											else if(lives==2)
												ST7735_DrawBitmap(140,8,fullheart,10,9);
										}
									}
									break;
					 case 1:if(treasure==1)
									{
										ST7735_DrawBitmap(70,76,treasurechest,17,15);
										if(lane==3 && ((143*Data/4095 < 71 && 143*Data/4095+20 >71)||(143*Data/4095 < 77 && 143*Data/4095+20 >77)))
										{
											treasure=0;
											Score+=120;
										}
									}
									break;
					 case 2:if(powerUp[2]==level)
								  {		
									  if(snakex==132)
										  snakedirection=0;	 
										if(snakex==0)
										  snakedirection=1;	 
									  if(snakedirection==1)
										 {
										 	 snakex+=1;
										 	 ST7735_DrawBitmap(snakex,75,FroggerSnakeright,31,12);
											 ST7735_FillRect(snakex-5,63,5,12,ST7735_GREEN);
										 }
										 else if(snakedirection==0)
										 {
										 	 snakex-=1;
											 ST7735_DrawBitmap(snakex,75,FroggerSnakeleft,31,12);
											 ST7735_FillRect(snakex+31,63,5,12,ST7735_GREEN);
										 }
								 }
								 break;
					}
				 }
				}
				if(((143*Data/4095<snakex && 143*Data/4095+19>snakex) || (143*Data/4095<snakex+30 && 143*Data/4095+19>snakex+30))&&lane==3&&level==3)
				{
					Delay100ms(6);
					lives-=1;
					//carhitblack=1;
					ST7735_FillRect(0,60,160,17,ST7735_GREEN);
					lane=0;		
				}
				
				if(clearvariable==1)
				{
					ST7735_FillRect(0,111,160,17,ST7735_GREEN);
					clearvariable=0;
				}
				if(lives==3 && hit4lives==1)
					ST7735_DrawBitmap(120,8,emptyheart,10,9);
				if(lives==2)
					ST7735_DrawBitmap(130,8,emptyheart,10,9);
				else if(lives==1)
					ST7735_DrawBitmap(140,8,emptyheart,10,9);
				else if(lives==0)
					break;
				if(ADCStatus==1)
				{
					Data=ADCMail;
					ADCStatus=0;	
				} 
				
				drawCars();
				ST7735_SetCursor(0,0);
				LCD_OutDec(Score);
				ST7735_DrawString(8,0,"Level ",ST7735_CYAN);
				ST7735_SetCursor(14,0);
				LCD_OutDec(level);
				if((GPIO_PORTD_DATA_R & 0x01) == 1 && buttonPress == 0)
				{
					buttonPress = 1;
					Sound_Play(0,7147);					
					Score+=10;
					if(lane==0||lane==3||lane==6)
						ST7735_FillRect(143*Data/4095-10,128-(lane*17)-15,40,15,ST7735_GREEN);
					else
						ST7735_FillRect(143*Data/4095-10,128-(lane*17)-15,40,15,ST7735_BLACK);
					lane++;			
				} 
				else if((GPIO_PORTD_DATA_R & 0x01) == 0 && buttonPress == 1)
				{
					buttonPress = 0; 	
				}
				if(lane==0||lane==3||lane==6)
				{
					if(!(Data+3 >= ADCMail && Data-3 <=ADCMail))
					{
						ST7735_FillRect((143*Data/4095)-20,128-(lane*17)-15,20,15,ST7735_GREEN);
						ST7735_FillRect((143*Data/4095)+20,128-(lane*17)-15,20,15,ST7735_GREEN);
					}
					ST7735_DrawBitmap(143*Data/4095,128-(lane*17)-1,frogGreen,20,15);	
				}
				else
				{
					if(!(Data+3 >= ADCMail && Data-3 <=ADCMail))
					{
						ST7735_FillRect((143*Data/4095)-20,128-(lane*17)-15,20,15,ST7735_BLACK);
						ST7735_FillRect((143*Data/4095)+20,128-(lane*17)-15,20,15,ST7735_BLACK);
					}
					ST7735_DrawBitmap(143*Data/4095,128-(lane*17)-1,frogBlack,20,15);		
				}
			}
			level++;
			lane=0;
			if(level==4)
				ST7735_FillRect(0,60,160,17,ST7735_GREEN);
			for(int i =0; i < 6; i++)
			{
				ST7735_FillRect(Cars[i].currentx,Cars[i].currenty -15,40,16,ST7735_BLACK);
			}
			for(int i = 0; i < 6; i++){
				Cars[i].currentx = (Random())%160;
				if(i==4)
				{
					if((Cars[0].currentx < Cars[4].currentx && Cars[0].currentx +36 > Cars[4].currentx)||(Cars[4].currentx < Cars[0].currentx && Cars[4].currentx +36 > Cars[0].currentx))
						i--;
				}
				else if(i==5)
				{
					if((Cars[3].currentx < Cars[5].currentx && Cars[3].currentx +36 > Cars[5].currentx)||(Cars[5].currentx < Cars[3].currentx && Cars[5].currentx +36 > Cars[3].currentx))
						i--;
				}
			}
			if(lives==0)
					break;
			Delay100ms(6);
			ST7735_FillRect(0,9,160,17,ST7735_GREEN);	
			
		}		
		endScreen();
	}
}


//You can use this timer only if you learn how it works
void Delay100ms(uint32_t count){
	uint32_t volatile time;
  while(count>0){
    time = 727240;  // 0.1sec at 80 MHz
    while(time){
	  	time--;
    }
    count--;
  }
}

void	SysTick_Handler(void){
	  ADCMail=ADC_In();
	  ADCStatus=1;
}
